import React from 'react';
import './orders.css';

function Orders(props) {

    mealId = (meal, orderId) => { 
        return meal._id === orderId;
    }

    return (
        <div id="orders">
        {console.log(props.meals)}
            <ul id="orders-list">
            {
                    props.orders !== [] && props.orders.map((x, i) => {
                        return (<li key={i} order_id={x._id}> {props.meals.find(meal => meal._id === x.meal_id) + ' - ' + x.user_id} </li>);
                    })
                }   
            </ul>
        </div>
    );
}

export default Orders;
